@ilkertantr @furkancerkes Komik çocuk
Benim soyum da Türk soyadım da sen kendi soy ağacına bak bakalım ermeni misin yunan mı.
Siz de aynı kafa ile devam edin Dünya'da kaybetme rekoru  elinde olan bir adaydan umut bekleyin biz Erdoğan'ı yine seçeceğiz.

